```python
def prepare_jobs(
    context: List[str],
    prev_job_manifests: Optional[List[JobManifest]] = None,
    prev_job_outputs: Optional[List[JobOutput]] = None,
) -> List[JobManifest]:
    job_manifests = []

    # Assuming each document is large, we will chunk it into smaller sections
    # for more manageable processing.
    for document in context:
        chunks = chunk_by_section(document, max_chunk_size=3000, overlap=20)

        # Create a task to extract total revenue for FY2019
        for chunk in chunks:
            job_manifests.append(JobManifest(
                chunk=chunk,
                task="Extract the total revenue for FY2019 from this chunk.",
                advice="Look for sections that mention revenue or income for the fiscal year 2019.",
                task_id=1
            ))

        # Create a task to extract total revenue for FY2020
        for chunk in chunks:
            job_manifests.append(JobManifest(
                chunk=chunk,
                task="Extract the total revenue for FY2020 from this chunk.",
                advice="Look for sections that mention revenue or income for the fiscal year 2020.",
                task_id=2
            ))

    return job_manifests


def transform_outputs(
    jobs: List[Job],
) -> str:
    # Initialize dictionaries to store revenue data
    revenue_2019 = []
    revenue_2020 = []

    # Process each job output
    for job in jobs:
        if job.output.answer:
            if job.manifest.task_id == 1:
                revenue_2019.append((job.output.answer, job.output.citation))
            elif job.manifest.task_id == 2:
                revenue_2020.append((job.output.answer, job.output.citation))

    # Aggregate the results
    aggregated_result = "FY2019 Revenue Data:\n"
    for revenue, citation in revenue_2019:
        aggregated_result += f"Revenue: {revenue}, Source: {citation}\n"

    aggregated_result += "\nFY2020 Revenue Data:\n"
    for revenue, citation in revenue_2020:
        aggregated_result += f"Revenue: {revenue}, Source: {citation}\n"

    return aggregated_result
