    for doc in context:
        chunks = chunk_by_section(doc, max_chunk_size=3000, overlap=20)

        for chunk in chunks:
            # Create a task for extracting total revenue for FY2019
            task_2019 = "Extract the total revenue for FY2019 from the statement of income."
            job_manifest_2019 = JobManifest(
                chunk=chunk,
                task=task_2019,
                advice="Look for sections labeled 'Total Revenue' or 'Net Revenue' for FY2019."
            )
            job_manifests.append(job_manifest_2019)

            # Create a task for extracting total revenue for FY2020
            task_2020 = "Extract the total revenue for FY2020 from the statement of income."
            job_manifest_2020 = JobManifest(
                chunk=chunk,
                task=task_2020,
                advice="Look for sections labeled 'Total Revenue' or 'Net Revenue' for FY2020."
            )
            job_manifests.append(job_manifest_2020)

